import React, { useEffect } from 'react';
import { observer } from 'mobx-react-lite';
import ProductCard from '../Components/ProductCard';
import productStore from '../Stores/ProductStore';
import './ProductsPage.css'

const ProductsPage = () => {

  useEffect(() => {
    // Simulated API call to fetch products
    const fetchProducts = async () => {
      const response = await fetch('https://dummyjson.com/products');
      const products = await response.json();
      productStore.setProducts(products.products);
      console.log(productStore.products[0].title);
    };
  
    fetchProducts();
  }, []);


  return (
    <div>
      {productStore.products.length > 0 && productStore.products.map((product) => (
        console.log(product), 
        <ProductCard key={product.id} product={product} className="product-card"/>
      ))}
    </div>
  );
};

export default observer(ProductsPage);

